import './App.css';
import React from 'react';
import Navbar from './components/Navbar';
import News from './components/News';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Routes>
          <Route exact path="/" element={<News pageSize={5} category="general"/>} />
          <Route exact path="/business" element={<News key="Business" pageSize={5} category="business"/>} />
          <Route exact path="/crime" element={<News  key="crime" pageSize={5} category="crime"/>} />
          <Route exact path="/entertainment" element={<News key="entertainment" pageSize={5} category="entertainment"/>} />
          <Route exact path="/environment" element={<News  key="environment" pageSize={5} category="environment"/>} />
          <Route exact path="/health" element={<News  key="health" pageSize={5} category="health"/>} />
          <Route exact path="/lifestyle" element={<News  key="Business" pageSize={5} category="lifestyle"/>} />
          <Route exact path="/science" element={<News  key="Business" pageSize={5} category="science"/>} />
          <Route exact path="/technology" element={<News  key="Business" pageSize={5} category="technology"/>} />
          <Route exact path="/politics" element={<News  key="Business" pageSize={5} category="politics"/>} />
          <Route exact path="/sports" element={<News  key="Business" pageSize={5} category="sports"/>} />
        </Routes>
      </Router>
    </>
  );
}

export default App;
